// FontFamilyConfig represents a font family configuration
type FontFamilyConfig struct {
	Value     string // System font name or file path
	IsBundled bool   // true if Value is a file path, false if system font
}

// ThemeFonts returns the font family mappings from theme.toml.
// These can be used with font-sans, font-serif, font-mono, etc. classes.
func ThemeFonts() map[string]FontFamilyConfig {
	return map[string]FontFamilyConfig{
		"sans": {Value: "system", IsBundled: false},
		"serif": {Value: "examples/fontbundle/example.ttf", IsBundled: true},
		"mono": {Value: "Menlo", IsBundled: false},
	}
}

// ptr returns a pointer to the value (helper for map initialization)
func ptr[T any](v T) *T {
	return &v
}

// strPtr returns a pointer to a string
func strPtr(s string) *string {
	return &s
}

// intPtr returns a pointer to an int
func intPtr(i int) *int {
	return &i
}

// hexToU32 converts a hex color string to a uint32 RGBA value
func hexToU32(hex string) uint32 {
	hex = hex[1:] // Remove #
	var r, g, b uint32
	fmt.Sscanf(hex, "%02x%02x%02x", &r, &g, &b)
	return (r << 24) | (g << 16) | (b << 8) | 0xFF // RGBA with full alpha
}
